        sentence: >-
          SELECT p.ProductID AS "id", p.ProductName AS "name", p.SupplierID AS
          "supplierId", p.CategoryID AS "categoryId", p.QuantityPerUnit AS
          "quantity", p.UnitPrice AS "price", p.UnitsInStock AS "inStock",
